'use strict';

var request = require('supertest');
var expect = require('chai').expect;
var CONST = require('../../constants/index');
var USERS = require('./../testHelpers/usersTemplates');
var SERVICES = require('./../testHelpers/servicesTemplates');
var async =  require('async');
var PreparingDB = require('./preparingDB');
var url = 'http://localhost:7791';


describe('TRA Services tests Complains Enquiries_Suggestion', function () {
    this.timeout(55000);

    var agent = request.agent(url);
    var lastServiceIconId;

    before(function (done) {
        console.log('>>> before');

        var preparingDb = new PreparingDB();

        async.series([
                preparingDb.dropCollection(CONST.MODELS.USER + 's'),
                //preparingDb.dropCollection(CONST.MODELS.SERVICES_ICON + 's'),
                preparingDb.toFillUsers(1),
                preparingDb.createUsersByTemplate(USERS.CLIENT)
            ],
            function (err, results) {
                if (err) {
                    return done(err)
                }
                console.log('BD preparing completed');
                done();
            });
    });

    it('Creating Icon for service, sending all types', function (done) {

        var loginData = USERS.CLIENT;
        var data = {
            '@2x': 'data:image/png;base64,',
            '@3x': 'data:image/png;base64,',
            'xxxhdpi': 'data:image/png;base64,',
            'xxhdpi': 'data:image/png;base64,',
            'xhdpi': 'data:image/png;base64,',
            'hdpi': 'data:image/png;base64,',
            'mdpi' :'data:image/png;base64,'
        };

        agent
            .post('/user/signIn')
            .send(loginData)
            .expect(200)
            .end(function (err, res) {
                if (err) {
                    return done(err)
                }

                agent
                    .post('/icon')
                    .send(data)
                    .expect(200)
                    .end(function (err, res) {
                        console.dir(res.body);
                        if (err) {
                            return done(err)
                        }
                        done();
                    });
            });
    });

    it('Creating Icon for service, sending NO all types', function (done) {
        var data = {
            '@2x' : '@2x',
            '@3x' : '@3x',
            'xxxhdpi' :  'xxxhdpi'
        };

        agent
            .post('/icon')
            .send(data)
            .expect(500)
            .end(function (err, res) {
                console.dir(res.body);
                if (err) {
                    return done(err)
                }
                done();
            });

    });

    it('Get all  "@3x" type servicesIcons', function (done) {
        var resp =[];

        agent
            .get('/icon/?type=@3x')
            .expect(200)
            .end(function (err, res) {
                resp = res.body;
                console.log(resp);
                console.log('resp.length : ',resp.length);
                if (err) {
                    return done(err)
                }
                lastServiceIconId = resp[resp.length - 1]._id;
                done();
            });
    });

    it('Get servicesIcon  by id', function (done) {
            agent
            .get('/icon/' + lastServiceIconId )
            .expect(200)
            .end(function (err, res) {
                console.dir( res.body);

                if (err) {
                    return done(err)
                }
                done();
            });
    });

    it('Get servicesIcon like file  by id AND type', function (done) {
        agent
            .get('/icon/' + lastServiceIconId + '/mdpi')
            .expect(200)
            .end(function (err, res) {
                console.dir( res.body);

                if (err) {
                    return done(err)
                }
                done();
            });
    });


});